import React from 'react'

import './App.css';

function App() {

	return(
		<div className="app">

			<div className="cards">

				<div className="card" >
					<div className="card-body" >
						<h1>Título do meu post</h1>
						<div className="line"></div>
						<h2>Conteudo da minha postagem, conteúdo da minha postagem</h2>
					</div>
				</div>

			</div>

		</div>
	)

}

export default App;
